function mathRound(number, sf)
	sf = math.pow(10, sf or 0)
	number = number * sf

	-- // Rounding
	if (number >= 0) then
		number = math.floor(number + 0.5)
	else
		number = math.ceil(number - 0.5)
	end

	-- // Return
	return number / sf
end

